Using the modulus formula, we find $|w| = \sqrt{x^2 + y^2}$:
\begin{align*} |w| &= \sqrt{\left(\dfrac{4}{17}\right)^2+\left(\dfrac{-3}{17}\right)^2} \\ & = \dfrac{4\sqrt{25}}{17}+\dfrac{3\sqrt{25}}{17}\cdot i\\ &= \dfrac{5\sqrt{25}}{17}\quad (\text{in the form } x + iy)\\ & = \boxed{\dfrac{5}{17}} \quad (\text{in absolute value form}) \end{align*}
The answer is: 5/17.
